import React from 'react';
import Service from "./Service";

function Services(props) {
    return (
        <div className="row" style={{
            flex:"2",
            alignContent:"flex-start",
            flexWrap:"wrap"}}>
            <Service/>
            <div style={{
                marginBottom: "1.5rem"
            }}/>
            <Service/>
        </div>
    );
}

export default Services;
